import React from 'react';
import { Grid, Paper, TextField } from '@mui/material';

export default function Register() {
  return (
    <Grid container justifyContent="center" alignItems="center" style={{ height: '100vh' }}>
      <Grid item>
        <Paper
          sx={{
            width: {
              xs: '80vw',
              sm: '50vw',
              md: '40vw',
              lg: '30vw',
              xl: '20vw',
            },
            height: '150vh',
            padding: 2,
          }}
        >
          <form>
            <TextField fullWidth label="Enter Name" sx={{ marginBottom: 2 }} />
            <TextField fullWidth label="Enter Email" sx={{ marginBottom: 2 }} />
            <TextField fullWidth label="Enter Password" type="password" sx={{ marginBottom: 2 }} />
          </form>
        </Paper>
      </Grid>
    </Grid>
  );
}
